import React, { Component } from "react";

class HeaderRight extends Component {
  render() {
    return (
      <>
        <div className="col header-right">
          <ul className="nav justify-content-end pe-5 align-items-center">
            <li className="nav-item text-center p-1">
              <button className="btn shadow-none fas fa-bell rounded-circle p-0">
                <span className="position-absolute top-0 start-100 translate-middle p-2 bg-danger border border-light rounded-circle">
                  <span className="visually-hidden">New alerts</span>
                </span>

                <span className="badge bg-warning text-dark">Warning</span>
              </button>
            </li>
            <li className="nav-item ms-3">
              <button className="btn shadow-none avatar rounded-circle p-0">
                <img
                  src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d18257ed-4e57-4286-8a9a-a49a3b93e279/dbyfs5p-7e980a4e-f75e-4dae-baa0-df92fad00a02.png?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..ntTZhcqRWsVbLzXTyQJtOAWQSPqe_-RW7FRLCDKbHoY"
                  alt=""
                />
              </button>
            </li>
          </ul>
        </div>
      </>
    );
  }
}

export default HeaderRight;
